import Card from "../components/Card";
import LoginButton from "../components/LoginButton";
import "./Login.css";

const Login = () => {
  return (
    <div className="login-page">
      <Card>
        <h1>Login Form</h1>
        <div>
          <LoginButton>Login</LoginButton>
        </div>
      </Card>
    </div>
  );
};

export default Login;
